import React, { useState, useEffect, useRef } from 'react';
import { Play, Pause, Square, Clock, CheckCircle } from 'lucide-react';

interface TimerScreenProps {
  isActive: boolean;
  duration: number; // in minutes
  activityName: string;
  onComplete: () => void;
  onStop: () => void;
}

export const TimerScreen: React.FC<TimerScreenProps> = ({
  isActive,
  duration,
  activityName,
  onComplete,
  onStop,
}) => {
  const [timeLeft, setTimeLeft] = useState(duration * 60); // Convert to seconds
  const [isRunning, setIsRunning] = useState(false);
  const [isPaused, setIsPaused] = useState(false);
  const intervalRef = useRef<NodeJS.Timeout | null>(null);
  const audioRef = useRef<HTMLAudioElement | null>(null);

  // Initialize timer when component becomes active
  useEffect(() => {
    if (isActive) {
      setTimeLeft(duration * 60);
      setIsRunning(true);
      setIsPaused(false);
    }
  }, [isActive, duration]);

  // Timer logic
  useEffect(() => {
    if (isRunning && !isPaused && timeLeft > 0) {
      intervalRef.current = setInterval(() => {
        setTimeLeft((prev) => {
          if (prev <= 1) {
            setIsRunning(false);
            // Play completion sound
            if (audioRef.current) {
              audioRef.current.play().catch(() => {
                // Ignore audio play errors
              });
            }
            // Show completion prompt
            setTimeout(() => {
              if (window.confirm(`Time's up! Have you completed "${activityName}"?`)) {
                onComplete();
              }
            }, 100);
            return 0;
          }
          return prev - 1;
        });
      }, 1000);
    } else {
      if (intervalRef.current) {
        clearInterval(intervalRef.current);
        intervalRef.current = null;
      }
    }

    return () => {
      if (intervalRef.current) {
        clearInterval(intervalRef.current);
      }
    };
  }, [isRunning, isPaused, timeLeft, activityName, onComplete]);

  const formatTime = (seconds: number) => {
    const mins = Math.floor(seconds / 60);
    const secs = seconds % 60;
    return `${mins.toString().padStart(2, '0')}:${secs.toString().padStart(2, '0')}`;
  };

  const getProgress = () => {
    const totalSeconds = duration * 60;
    return ((totalSeconds - timeLeft) / totalSeconds) * 100;
  };

  const handlePlayPause = () => {
    if (isRunning && !isPaused) {
      setIsPaused(true);
    } else {
      setIsPaused(false);
      if (!isRunning) {
        setIsRunning(true);
      }
    }
  };

  const handleStop = () => {
    setIsRunning(false);
    setIsPaused(false);
    setTimeLeft(duration * 60);
    onStop();
  };

  const circumference = 2 * Math.PI * 120;
  const strokeDashoffset = circumference - (getProgress() / 100) * circumference;

  if (!isActive) return null;

  return (
    <div className="fixed inset-0 bg-gradient-to-br from-purple-900 via-purple-800 to-pink-800 flex items-center justify-center z-50">
      <audio ref={audioRef} preload="auto">
        <source src="data:audio/wav;base64," type="audio/wav" />
      </audio>

      <div className="bg-white rounded-3xl p-8 max-w-md w-full mx-4 shadow-2xl">
        {/* Header */}
        <div className="text-center mb-8">
          <h1 className="text-2xl font-bold text-gray-800 mb-2">{activityName}</h1>
          <p className="text-gray-600">Focus Session</p>
        </div>

        {/* Timer Circle */}
        <div className="relative flex items-center justify-center mb-8">
          <svg className="w-64 h-64 transform -rotate-90" viewBox="0 0 256 256">
            {/* Background circle */}
            <circle
              cx="128"
              cy="128"
              r="120"
              stroke="#E5E7EB"
              strokeWidth="8"
              fill="none"
            />
            {/* Progress circle */}
            <circle
              cx="128"
              cy="128"
              r="120"
              stroke="url(#gradient)"
              strokeWidth="8"
              fill="none"
              strokeLinecap="round"
              strokeDasharray={circumference}
              strokeDashoffset={strokeDashoffset}
              className="transition-all duration-1000 ease-in-out"
            />
            {/* Gradient definition */}
            <defs>
              <linearGradient id="gradient" x1="0%" y1="0%" x2="100%" y2="100%">
                <stop offset="0%" stopColor="#EC4899" />
                <stop offset="50%" stopColor="#EF4444" />
                <stop offset="100%" stopColor="#F59E0B" />
              </linearGradient>
            </defs>
          </svg>
          
          {/* Timer display */}
          <div className="absolute inset-0 flex flex-col items-center justify-center">
            <div className="text-5xl font-bold text-gray-800 mb-2">
              {formatTime(timeLeft)}
            </div>
            <div className="text-sm text-gray-500">
              {isRunning && !isPaused ? 'Running' : isPaused ? 'Paused' : 'Stopped'}
            </div>
          </div>
        </div>

        {/* Progress indicator */}
        <div className="mb-6">
          <div className="flex justify-between text-sm text-gray-600 mb-2">
            <span>Progress</span>
            <span>{Math.round(getProgress())}%</span>
          </div>
          <div className="w-full bg-gray-200 rounded-full h-2">
            <div 
              className="bg-gradient-to-r from-pink-500 to-orange-500 h-2 rounded-full transition-all duration-1000"
              style={{ width: `${getProgress()}%` }}
            />
          </div>
        </div>

        {/* Control buttons */}
        <div className="flex justify-center space-x-4">
          <button
            onClick={handlePlayPause}
            className="flex items-center justify-center w-16 h-16 bg-gradient-to-r from-pink-500 to-red-500 text-white rounded-full hover:from-pink-600 hover:to-red-600 transition-all duration-200 shadow-lg"
          >
            {isRunning && !isPaused ? (
              <Pause size={24} />
            ) : (
              <Play size={24} />
            )}
          </button>
          
          <button
            onClick={handleStop}
            className="flex items-center justify-center w-16 h-16 bg-gray-500 text-white rounded-full hover:bg-gray-600 transition-all duration-200 shadow-lg"
          >
            <Square size={24} />
          </button>
        </div>

        {/* Time zones display (decorative) */}
        <div className="mt-8 space-y-2">
          <div className="flex justify-between text-sm">
            <span className="text-gray-600">New York</span>
            <span className="text-gray-800">{new Date().toLocaleTimeString('en-US', { timeZone: 'America/New_York', hour12: false })}</span>
          </div>
          <div className="flex justify-between text-sm">
            <span className="text-gray-600">London</span>
            <span className="text-gray-800">{new Date().toLocaleTimeString('en-US', { timeZone: 'Europe/London', hour12: false })}</span>
          </div>
          <div className="flex justify-between text-sm">
            <span className="text-gray-600">Tokyo</span>
            <span className="text-gray-800">{new Date().toLocaleTimeString('en-US', { timeZone: 'Asia/Tokyo', hour12: false })}</span>
          </div>
          <div className="flex justify-between text-sm">
            <span className="text-gray-600">Sydney</span>
            <span className="text-gray-800">{new Date().toLocaleTimeString('en-US', { timeZone: 'Australia/Sydney', hour12: false })}</span>
          </div>
        </div>
      </div>
    </div>
  );
};